getName proc
            
            mov ch,0
            mov cl,0
            jmp getCh
            
    endByEnter:
            mov ah,0
            int 16h 
            jmp endGetName
            
    consumeBuffer:
            mov ah,0
            int 16h        
        
    getCh: ;read 1 ch
            mov ah,1
            int 16h   
            jnz validation
            jz getCh
     
            
    validation:
            cmp cl,0
            jz isLetter
            cmp ah,1ch
            jz endByEnter
            jmp echoIt
    
    isLetter:
            cmp al,65
            jl consumeBuffer
            cmp al,90
            jl echoIt
            cmp al,97
            jl consumeBuffer
            cmp al,122
            jg consumeBuffer
            ;Valid then echo        
    
    echoIt:
        mov ah,2
        mov dl,al
        int 21h
        inc cl
        ;store in data
        mov si,cx
        mov Name1[si+1],al
        cmp cl,15 ;no more ch needed
        jl consumeBuffer
    
    lastButton:   ;if name reached size limit
        call waitEnter
    
    endGetName:   ;store in data
        mov Name1[1],cl
            
    ret     
    endp getName

waitEnter proc
            
    jmp getButton
    popButton:
    ;pop the button (called after any input) 
        mov ah,0
        int 16h    
    ;Get Enter key
    getButton:    
        mov ah,1
        int 16h
        jnz Enter ;if user entered button it will jmp
        jmp getButton ;no button entered try again
    
    Enter:
        cmp ah,1ch
        jnz popButton ; if button is not Enter, repeat 
        ;button is Enter
        ;pop it from buffer       
        mov ah,0
        int 16h  
        
    ret     
    endp waitEnter 

end main   